import React from "react";
import Category from "./Category";

const About = () =>{
    return(
        <>
            <div class="container">
                <div class="row">
                    <div class="col-md-3">
                        <Category data="About Us"/>
                    </div>
                    <div class="col-md-9">
                        <div className="about-image">

                        </div>
                    </div>
                </div>
            </div>
        </>
    );
}
export default About;
